importClass(Packages.ca.phon.query.script.params.DiacriticOptionsScriptParam)

var ignoreDistortedDiacriticParamInfo = {
	"id": "ignoreDistortedDiacritic",
	"title": "Ignore Distortion",
	"desc": "Phones marked as 'distorted' (\u25cc\u033e) will be considered correct",
	"def": false
};
var ignoreDistoredDiacriticParam;

var diacriticOptionsParamInfo = {
	"id": "diacriticOptions",
	"desc": "Diacritic Options",
	"def": false,
	"retainDia": new java.util.ArrayList()
};
var diacriticOptionsParam;
var diacriticOptions = {};

function init(inputs, outputs) {
	inputs.add("table", "");
	outputs.add("table", "", false, DefaultTableDataSource);
}

function setup_params(params) {
	diacriticOptionsParam = new DiacriticOptionsScriptParam(
		diacriticOptionsParamInfo.id,
		diacriticOptionsParamInfo.desc,
		diacriticOptionsParamInfo.def,
		diacriticOptionsParamInfo.retainDia
	);
	params.add(diacriticOptionsParam);

	ignoreDistortedDiacriticParam = new BooleanScriptParam(
		ignoreDistortedDiacriticParamInfo.id,
		ignoreDistortedDiacriticParamInfo.desc,
		ignoreDistortedDiacriticParamInfo.title,
		ignoreDistortedDiacriticParamInfo.def);
	params.add(ignoreDistortedDiacriticParam);
}

function getRowValue(table, row) {
	var targetColIdx = table.getColumnIndex("IPA Target");
	var actualColIdx = table.getColumnIndex("IPA Actual");
	if(targetColIdx < 0 || actualColIdx < 0) return false;



	var ipaTarget = row[targetColIdx];
	var ipaActual = row[actualColIdx];
	if(ipaTarget == null || ipaActual == null) return false;

	if("ˈoto" == ipaTarget.toString()) {
		java.lang.System.out.println("here");
	}

	if(diacriticOptions.ignoreDiacritics == true) {
		if("only" == diacriticOptions.selectionMode.toString().toLowerCase()) {
			ipaTarget = ipaTarget.stripDiacritics(diacriticOptions.selectedDiacritics);
			ipaActual = ipaActual.stripDiacritics(diacriticOptions.selectedDiacritics);
		} else {

			ipaTarget = ipaTarget.stripDiacriticsExcept(diacriticOptions.selectedDiacritics);
			ipaActual = ipaActual.stripDiacriticsExcept(diacriticOptions.selectedDiacritics);
		}
	}

	var accurate = ipaTarget.length() == ipaActual.length();
	if(accurate == true) {
		for(var pidx = 0; pidx < ipaTarget.length(); pidx++) {
			var ipaT = ipaTarget.elementAt(pidx);
			var ipaA = ipaActual.elementAt(pidx);

			accurate &= (ipaT.getText() == ipaA.getText() ||
				(ignoreDistortedDiacritic == true && ipaA.featureSet.hasFeature("distorted")));
		}
	}
	return accurate;
}

function run(context) {
	var table = context.get("table");

	table.setColumnTitle(table.columnCount, "Accurate");

	for(var row = 0; row < table.rowCount; row++) {
		var rowValue = getRowValue(table, table.getRow(row));
		table.setValueAt(row, "Accurate", rowValue);
	}
}

// setup input/output fields
function init(inputFields, outputFields) {
	inputFields.add("table", "");
	outputFields.add("exists", "does table exist", false, java.lang.Boolean);
	outputFields.add("table", "table if exists, undefined otherwise", false, Packages.ca.phon.query.report.datasource.DefaultTableDataSource);
}

function run(context) {
	var tableExists =
		(context.containsKey("table") && context.get("table") != null);
	context.put("exists", tableExists);
	context.put("table", context.get("table"));
}

